import React from 'react';
import Card from '../UI/Card';
import Button from '../UI/Button';


const LinkComponent = (props) => {
  return (
    <Card>
      <h1> View all my React Projects</h1>
    <Button />
    </Card>
  )
};

export default LinkComponent;
